import React from "react";
import "../styles/About.css";
import faceImage from "../assets/images/14.jpg";

const About = () => {
  return (
    <div className="about-container">
      <div className="about-banner" style={{ backgroundImage: `url(${faceImage})` }}>
        <div className="about-text">
        <h1>MEET MARIO STROEYKENS</h1>
<p>
  Mario Stroeykens is a rising football talent from Belgium with a growing presence on and off the pitch.
  Known for his composure, creativity, and technical ability, he’s already making a mark in European football.
  Off the field, Mario brings a thoughtful, grounded perspective to life in the spotlight — blending sport, style, and identity with authenticity.
</p>

        </div>
      </div>
    </div>
  );
};

export default About;
